import React from 'react';
import styled from 'styled-components';
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
`;

function SlideTwo() {
  return (
    <StyledSlideTwo>
      <CarInfoDisplay />
    </StyledSlideTwo>
  );
}

export default SlideTwo;
